import React, {Component} from 'react';
import {Button, Block} from 'components';

class App extends Component {
  render(){
    return (
      <div className="wrapper ">
        <Block>
          <Button className="button__large" type="primary" size="large">
            This is button
          </Button>
        </Block>
      </div>
    );
  }
}

export default App;
